    numericProperty: 28
}
</code></pre>
<p>I want to do an aggregation group stage that gives me a structure of the shape:</p>
<pre><code>{
    _id: &quot;xyz&quot;,
    name: &quot;xyz&quot;,
    numericProperty: {
        min: minvalue,
        max: maxvalue,
        avg: avgvalue
    }
}
</code></pre>
