MongoDB $set query in mongoose: Updating an object inside a nested document array<p>Could someone help me find the mongoose equivalent of this mongosh query?</p>
<p>I have this data:</p>
<pre><code>{ 
data: [ 
  {
    x: 1,
    y: 1
  },
  {
    x: 11,
    y: 11
  },
  {
    x: 111,
    y: 111
  } 
]
}
</code></pre>
<p>In order to update a nested object inside an array, I do this in Mongo SH and it works:</p>
<pre><code>*.updateOne({_id: 'ID_HERE', &quot;data.x&quot;: 1}, {$set: {&quot;data.$&quot;: { x: 2, y: 2 }} })
</code></pre>
<p>How would I do this in mongoose? This is how I have ran it</p>
<pre><code>const result = await Positions.updateOne(
            { _id: collectionId, &quot;data.x&quot;: 1 },
            {
                $set: {
                    &quot;data.$&quot;: { x: 2, y: 2 },
                },
            }
        );
</code></pre>
<p>Response from *.updateOne:</p>
<pre><code>{
    &quot;acknowledged&quot;: false
}
</code></pre>
<p>Response from *.findOneAndUpdate simply returns the same data untouched</p>
<p>Though the update does not happen.
Using mongoose v6.0.6</p>
<p>I believe the issue is with the <code>$</code> position selector. If I change <code>$set</code> to update &quot;data&quot; directly instead of &quot;data.$&quot;, it works, but of course, it is not what I want as it replaces the entire data array.</p>
<p>EDIT:
Thanks to Joe's answer, I found the problem.
The problem was actually in the Schema.
data was set as an object instead of array of objects
So I updated the Schema from <code>data: {x: Number, y: Number}</code> to <code>data:[{x: Number, y: Number}]</code></p>

