Mongoose discriminator is ignoring an extra field<p>So, I have a <code>Category</code> model with three discriminators on it. One of them, &quot;Allowance&quot; has a new Schema for an extra field. However, when a new Category is saved to the DB, that field will not save, it is being thrown out by Mongoose.</p>
<pre><code>const CategorySchema = new mongoose.Schema({
    name: {
        type: String,
        required: [true, &quot;MUST HAVE A NAME&quot;],
        validate: {
            validator: isSanitary,
            message: &quot;NAME CONTAINS ILLEGAL CHARACTERS&quot;
        }
    },
    amount: {
        type: Number,
        required: [true, &quot;MUST CONTAIN AN AMOUNT&quot;]
    },
    removed: {
        type: Boolean,
        default: false
    }
}, {discriminatorKey: &quot;kind&quot;});
const Category = mongoose.model(&quot;Category&quot;, CategorySchema);

Category.discriminator(&quot;Income&quot;, new mongoose.Schema());

Category.discriminator(&quot;Bill&quot;, new mongoose.Schema());

Category.discriminator(&quot;Allowance&quot;,
    new mongoose.Schema({
        isPercent: {
            type: Boolean,
            required: true
        }
    })
);

module.exports = {
    Income: Income,
    Bill: Bill,
    Allowance: Allowance,
    CategorySchema: CategorySchema
};
</code></pre>
<p>Requiring the model:</p>
<pre><code>const {Income, Bill, Allowance} = require(&quot;../models/category.js&quot;);
</code></pre>
<p>Code for creating a new Category:</p>
<pre><code>/*
    POST: create a new Category
    req.body = {
        account: String (Account id)
        name: String
        amount: Number
        kind: String (Income, Bill, Allowance)
        isPercent: Boolean
    }
    response: Category
    */
    createCategory: function(req, res){
        let category = {
            name: req.body.name,
            amount: req.body.amount,
            removed: false
        };

        switch(req.body.kind){
            case &quot;Income&quot;:
                category = new Income(category);
                break;
            case &quot;Bill&quot;:
                category = new Bill(category);
                break;
            case &quot;Allowance&quot;:
                category = new Allowance(category);
                category.isPercent = req.body.isPercent;
                break;
        }

        res.locals.user.accounts.id(req.body.account).categories.push(category);

        res.locals.user.save()
            .then((user)=&gt;{
                return res.json(category);
            })
            .catch((err)=&gt;{
                console.error(err);
                return res.json(&quot;ERROR: unable to create new category&quot;);
            });
    },
</code></pre>
<p>When a new &quot;Allowance&quot; is saved, it saves fine, except that <code>isPercent</code> is not saved to the DB. This was working previously but then stopped when I made a tiny change. The only change is that I started exporting the Schema as well as the model. I have no idea how to even debug this issue.</p>
<p>Thanks for any help.</p>

